import { Footer } from "./footer/footer";
import { Header } from "./header/header";
import { Main } from "./main/main";
import { BrowserRouter as Router, Route } from 'react-router-dom';

export default function App() {
  return (
    <Router>
      <div className="block py-1">
        <Header />
        <Main />
        <Footer />
      </div>
    </Router>
  );
}
